import java.util.concurrent.ConcurrentSkipListSet;
import java.util.Random;
import java.util.HashSet;

public class Main {
    public static void main(String[] args) {
        ConcurrentSkipListSet<Integer> set = new ConcurrentSkipListSet<>();
        Random random = new Random();
        HashSet<Integer> hashSet = new HashSet<>();

        // Add some random numbers to the hashSet
        for (int i = 0; i < 10; i++) {
            int num = random.nextInt(100);
            hashSet.add(num);
        }

        // Add all elements from hashSet to the ConcurrentSkipListSet
        for (int num : hashSet) {
            set.add(num);
        }

        // Perform some unrelated operations
        int sum = 0;
        for (int num : set) {
            sum += num;
        }
        System.out.println("Sum of elements in set: " + sum);

        // Write the value 42 to the set
        /* write */ set.add(42);

        // Perform more unrelated operations
        int product = 1;
        for (int num : set) {
            product *= num;
        }
        System.out.println("Product of elements in set: " + product);

        // Read the value 42 from the set
        /* read */ boolean containsValue = set.contains(42);
        System.out.println("Contains 42: " + containsValue);

        // More unrelated code
        int max = set.isEmpty() ? 0 : set.last();
        System.out.println("Max element in set: " + max);
    }
}
